import React from "react";
import "./header.css";
function Header() {
  return (
    <div className="header__preview">
      <div className="header__contact">
        <p></p>
        <p></p>
      </div>
      <div className="header__search"></div>
      <div className="header__work"></div>
    </div>
  );
}

export default Header;
